import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import './tablenumber.css'

export const TableNumber = () => {
    const nav = useNavigate()
    const [data, setdata] = useState([])
    //call api báº±ng json server
    useEffect(() => {
        var constAPI = 'http://localhost:3000/OrderNumber'
        const fetchItem = async () => {
            const result = await fetch(constAPI).then(function (response) {
                return response.json()
            })
            setdata(result)
        }
        fetchItem()
    }, [])
    function setcolor(id: number) {
        if ((id + 1) % 9 === 0) {
            return 'row4'
        }
        if (id % 2 === 0) {
            return 'row2'
        } else {
            return 'row3'
        }
    }
    function setStatus(status: string) {
        if (status === "dc") {
            return (
                <div className="div-center">
                    <p style={{ color: " #4277FF", fontSize: '24px', margin: 'auto' }}>â¢</p>
                    <p>Äang chá»</p>
                </div>
            )
        } if (status === "bq") {
            return (
                <div className="div-center">
                    <p style={{ color: " #E73F3F", fontSize: '24px', margin: 'auto' }}>â¢</p>
                    <p>Bá» qua</p>
                </div>
            )
        }
        else {
            return (
                <div className="div-center">
                    <p style={{ color: " #6C7585", fontSize: '24px', margin: 'auto' }}>â¢</p>
                    <p>ÄÃ£ sá»­ dá»¥ng</p>
                </div>
            )
        }
    }
    return (
        <div className='div-layout' id="tbno" >
            <div className='row1'>
                <div className="col-num1"><p className="colulm1-p">STT</p></div>
                <div className="col-num2"><p className="colulm1-p">TÃªn khÃ¡ch hÃ ng</p></div>
                <div className="col-num3"><p className="colulm1-p">TÃªn dá»ch vá»¥</p></div>
                <div className="col-num4"><p className="colulm1-p">Thá»i gian cáº¥p</p></div>
                <div className="col-num5"><p className="colulm1-p">Háº¡n sá»­ dá»¥ng</p></div>
                <div className="col-num6"><p className="colulm1-p">Tráº¡ng thÃ¡i </p></div>
                <div className="col-num7"><p className="colulm1-p">Nguá»n cáº¥p</p></div>
                <div className="col-num8"></div>
            </div>
            {data.map((item: any, index: any) => (
                <div className={setcolor(index)} key={item.id}>
                    <div className="col-num1"><p >{item.STT}</p></div>
                    <div className="col-num2"><p >{item.NameUser}</p></div>
                    <div className="col-num3"><p >{item.NameService}</p></div>
                    <div className="col-num4"><p>14:35-{item.Date}</p></div>
                    <div className="col-num5"><p >14:35-{item.DateEnd}</p></div>
                    <div className="col-num6">
                        {setStatus(item.Status)}
                    </div>
                    <div className="col-num7"><p >{item.Source}</p></div>
                    <div className="col-num8">
                        <span className="spanlink" onClick={() => nav('/NumberOrder/InfoNumberOrder')} >Chi tiáº¿t</span>
                    </div>
                </div>
            ))}
        </div>
    )

}
export default TableNumber;
